import styled from "styled-components";

export const filterButton = styled.div`
  border: 1px solid #d9d9d9;
  border-radius: 4px;
  width: 323px;
  height: 54px;
  background-color: white;
  display: flex;
  flex-direction: row;
  gap: 130px;
  font-family: "Roboto";
  font-style: normal;
  font-weight: 400;
  font-size: 20px;
  line-height: 17px;
`;

export const p = styled.p`
width:14px;

  cursor: none;
`;

export const dropdown = styled.div`
  position: absolute;
  width: 324px;
  height: 296px;
  border: 1px solid #dcdcdc;
  border-radius: 6px;
  background-color: white;
`;
